message:
ConditionalSystem refactored:
- processEntity() method overriden to push a local context with the "$_this" variable that points to the entity that owns the condition. The code is sth as simple as:
```java
public void processEntity(Entity owner, float delta){
   variablesSystem.push().localOwnerVar(entity);
   doProcessEntity(entity, deltaTime);
   variablesSystem.pop();
}
public abstract void doProcessEntity(Entity entity, float deltaTime);
```
As a consequence, it was not necessary to pass Entity owner to the evaluateCondition method, which has been simplified
